import styled from "styled-components/native";

export const FirstView2 = styled.View`
flex-direction: row;
align-items: center;
justify-content:space-between;
margin:20px;
`;

export const BigText2 = styled.Text`
font-family: 'Roboto';
font-style: normal;
font-weight: 300;
font-size: 24px;
line-height: 28px;
text-align: center;
color: #C3AD60;
`;

export const SecondView2 = styled.View`
margin-top: 123px;
align-items: center;
justify-content: center;
`;

export const Imagebox = styled.View`
height: 180px;
width: 180px;
background-color: rgba(78,78,78,0.5);
border-color: rgba(128, 128, 128, 0.5);
border-style: dashed;
border-width: 2px;
align-items: center;
justify-content: center;
border-radius: 20px;
`; 

export const BtnText = styled.Text`
font-family: 'Roboto';
font-style: normal;
font-weight: 300;
font-size: 18px;
line-height: 21px;
text-align: center;
letter-spacing: -0.333333px;
color: #000000;

`
